import React from 'react';
import {BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";
import './App.css';

import Login from './Pages/Login'
import Register from './Pages/Register'
import LocalPayments from './Pages/LocalPayments';
import InternationalPayments from './Pages/InternationalPayments';

const App = () => {
    return(
        <Router>
        <Routes>
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/LocalPayments" element={<LocalPayments />} />
          <Route path="/InternationalPayments" element={<InternationalPayments />} />
          {/* Define other routes here */}
        </Routes>
      </Router>
    );
}

export default App;
